g=A.a([new A.b7("Hyperlipidemia Enrollment Form","Hyperlipidemia, also known as high cholesterol, is a condition in which there is too much cholesterol or other fats (lipids) in the blood. Cholesterol is a waxy substance that is essential for the body to function properly. However, too much cholesterol can build up in the arteries and increase the risk of heart disease, stroke, and other health problems.\nThere are two main types of cholesterol: low-density lipoprotein (LDL) cholesterol and high-density lipoprotein (HDL) cholesterol. LDL cholesterol is known as the 'bad' cholesterol because it can build up in the arteries. HDL cholesterol is known as the 'good' cholesterol because it helps to remove LDL cholesterol from the arteries.\nTriglycerides are another type of fat that can build up in the blood. Triglycerides are a type of fat that the body uses for energy. However, too many triglycerides can also increase the risk of heart disease.",a0,"")],r)
